import Card from '../Card/Card';


export default function Cards({dogs}) {
   return (
      <div>
         <card>

         {
            dogs.map(({id, name, temperaments, life_span, weight, height, image}) => {
               return (
                  <Card
                    key={id}
                    id={id}
                    name={name}
                    temperaments={temperaments}                     
                    life_span={life_span}
                    weight={weight.metric}
                    height={height.metric}
                    image={image.url}
                    onClose={onClose}
                  />
               )
            })
         }
         </card>
      </div>
   );
}
